import React, {useState} from 'react';
import axios from "axios";

export default function SignupForm() {
    const [email, setEmailValue] = useState("");
    const [password, setPasswordValue] = useState("");
    const [full_name, setFullNameValue] = useState("");
    const [phone, setPhoneValue] = useState("");
    const [image, setImageValue] = useState(null);
  return (
    <div>
        <div class="mb-3">
            <label for="exampleFormControlInput1" class="form-label">Email address</label>
            <input type="email" class="form-control" id="emailInput" placeholder="name@example.com" onChange={e => setEmailValue(e.target.value)} value={email}/>
        </div>
        <div class="mb-3">
            <label for="exampleFormControlInput1" class="form-label">Password</label>
            <input type="password" class="form-control" id="passwordInput" onChange={e => setPasswordValue(e.target.value)} value={password}/>
        </div>
        <div class="mb-3">
            <label for="exampleFormControlInput1" class="form-label">Name</label>
            <input type="text" class="form-control" id="nameInput" placeholder="Vasya Pupkin" name="name" value={full_name}/>
        </div>
        <div class="mb-3">
            <label for="exampleFormControlInput1" class="form-label">Phone</label>
            <input type="text" class="form-control" id="phoneInput" placeholder="+380671234567" name="phone" value={phone}/>
        </div>
        <div class="input-group mb-3">
            <input type="file" class="form-control" id="inputGroupFile02" name="image" value={image}/>
            <label class="input-group-text" for="inputGroupFile02">Photo</label>
        </div>
        <div class="mb-3">
            <button type="button" class="btn btn-primary"
                 onClick={async () => {
                    console.log(full_name);
                    try {
                      await axios({
                        url: "http://localhost/auth/signup/",
                        headers: {
                          "Content-type": "application/json"
                        },
                        params: {
                          field: full_name
                        },
                        method: "POST",
                        data: null
                      }).then(({ data }) => {
                        return data;
                      });
                    } catch (e) {
                      console.log("Sending error", e);
                    }
                  }}

            >Register new user</button>
        </div>
    </div>
  )
}
